import { createTheme, makeStyles } from "@mui/styles";

const useStyles = makeStyles((theme) => ({
    constainer: {
        backgroundColor: theme.palette.background.paper,
        padding: theme.spacing(8,0,6)
    }
}));

export default useStyles
